
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Tiger Supplements</title>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.0/css/all.min.css">
    <style>
        body {
            margin: 0;
            padding: 0;
            background: linear-gradient(135deg, #111, #222);
            color: #fff;
            font-family: 'Arial', sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            min-height: 100vh;
            text-align: center;
        }
        .logo img {
            width: 180px;
            margin-bottom: 20px;
        }
        .tagline {
            font-size: 20px;
            margin-bottom: 40px;
            color: #ccc;
        }
        .social-buttons {
            display: flex;
            flex-direction: column;
            gap: 15px;
            width: 80%;
            max-width: 320px;
        }
        .button {
            display: flex;
            align-items: center;
            justify-content: center;
            text-decoration: none;
            background-color: gold;
            color: #000;
            font-size: 18px;
            font-weight: bold;
            padding: 12px;
            border-radius: 8px;
            transition: background 0.3s;
        }
        .button i {
            margin-right: 10px;
        }
        .button:hover {
            background-color: #ffd700;
        }
    </style>
</head>
